import React, { useState } from 'react'
import { PropObject, useSavePropertyMutation } from '../../generated/graphql'
import { PropertyForm } from './PropertyForm';


interface Props {
    property: PropObject;
}

export const newProperty: PropObject = { 
                    beds_adult: 0,
                    beds_kids: 0,
                    beds_tent: 0,
                    title: "",
                    id: 0,
                    images: [],
                    lat: 0.0,
                    location: "",
                    long: 0.0,
                    subtext: ""}

export const PropertyEditor: React.FC<Props> = (props) => {

    const [selectedProp, setSelectedProp] = useState();
    const [saveProperty] = useSavePropertyMutation();

    setSelectedProp(props.property)

    async function onSubmit(values: PropObject) {
        console.log(values)

        var val: PropObject = { beds_adult: values.beds_adult,
        beds_kids: values.beds_kids,
        beds_tent: values.beds_tent,
        title: values.title,
        id: values.id,
        images: values.images,
        lat: values.lat,
        location: values.location,
        long: values.long,
        subtext: values.subtext
        }
        var result = await saveProperty({
            variables: {
                property: val
            }
        });
        console.log(result)
    }

    return(
        <PropertyForm property={selectedProp} onSubmit={onSubmit}/>  
    )



}
